import imageSrProgranomo from "./img/logonegro.jpg";
import "./App.css";
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Routes,
  Route,
  Link,
} from "react-router-dom";
import Contact from "./pages/Contact";
import Profile from "./pages/Profile";

function App() {
  const misproyectos = async () => {
    const open = await fetch("https://github.com/proyectosaruiz/api");
    console.log(open);
  };
  return (
    <div className="App">
      <header className="App-header">
        <h1 className="title">Mis Proyectos</h1>
        <img src={imageSrProgranomo} alt="srprogranomo" className="img-home" />
        <button onClick={misproyectos} className="btn-search">
          Proyectos JavaScript
        </button>
      </header>
      <Router>
        <div>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              {/* Haremos la ruta y cuando carguemos se iniciara routes*/}
              <Link to="/contact">Contacto</Link>
            </li>
            <li>
              <Link to="/profile">Profile</Link>
            </li>
          </ul>
        </div>
        <Routes>
          <Route path="/contact" element={<Contact />}></Route>
          <Route path="/profile/:name" element={<Profile />}></Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
